import ChatMessage from "./demos/props/chat-message";
import SpeakButton from "./demos/props/speak-button";
import AlertButton from "./demos/props/alert-button";
import WelcomeMessage from "./demos/props/welcome-message";
import SocialPost from "./demos/props/social-media";
import ClickButton from "./demos/props/state/click-button";
import SpeakForm from "./demos/props/state/speak-form";
//import customIncrement from "./demos/props/state/CustomIncrement";
//components can take inputs in the form of props (or properties).
//pascal case
//to start the terminal its ctrl + `
//to make a browser its npm run start
//a (functional) component is just a js function that returns jsx
function App() {
  //inside of jsx, it allows us to insert a js expression
  return (
    <main>
      <h1>Henloooo</h1>
      <p>My first react app!</p>
      <h2>Custom Increment</h2>
      <customIncrement/>
      <h2>Speak Form</h2>
      <SpeakForm />
      <h2>Stateful Buttons</h2>
      <ClickButton>lol</ClickButton>
      <h2>Welcome</h2>
      {/*name and greeting become properties on an object passed in to the Welcome message*/}
      <WelcomeMessage name="jo" greeting="Hello buddy!" />
      <WelcomeMessage name="jose" greeting="sup bro" />
      <WelcomeMessage name="person" greeting="Welcome" />
      <h2>Buttons</h2>
      <SpeakButton message="Hello there" rate={1} pitch={1} />
      <SpeakButton message="Speeeeen" rate={5} pitch={2} />
      <h2>Alert buttons</h2>
      <AlertButton message="Alert" />
      <AlertButton message="alertMessage" />
      <h2>Chat</h2>
      <ChatMessage
        message="Hey!, how the coding going bud"
        userName="polaroids"
        date="02/15/21"
      />
      <ChatMessage
        message="it's going well, learning at least"
        userName="pottedplant"
        date="02/15/21"
      />
      <ChatMessage
        message="Hopefully you'll get a hang of it :)"
        userName="polaroids"
        date="02/15/21"
      />

      <h2>Social Media</h2>
      <SocialPost
        message="just procrastincating, ps. i suck at writing that word."
        userName="Pk444 "
        buts1="LIke"
        buts2=":)"
        buts3=":/"
      />
      <SocialPost
        message="used to play superman 64, it was bad but good type of game."
        userName="Protonhenry "
        buts1="LIke"
        buts2=":)"
        buts3=":/"
      />
    </main>
  );
}

export default App;
